import React, { Component } from 'react';

class Portfolio extends Component {
    render(){
        return (
            <div>
                <h1>Engineering Students' Society</h1>
                <img src="images/Oscars.png" className="portfolio-image"/>
                <img src="images/UnderTheStars.png" className="portfolio-image"/>
                <img src="images/DustedSummer.jpg" className="portfolio-image"/>
                <img src="images/EngballDodgeball.jpg" className="portfolio-image"/>

                <h1>IEEE uOttawa Branch</h1>
                <img src="images/AgileWorkshop.png" className="portfolio-image"/>

                <h1>Barbara Pritchard, Pianist</h1>
                <img src="images/Ballad_script.jpg" className="portfolio-image"/>
                <img src="images/Uncaged.jpg" className="portfolio-image"/>
                <img src="images/PlayingWithFire.png" className="portfolio-image"/>

                <img src="images/" className="portfolio-image"/>
            </div>
        );
    }
}

export default Portfolio;
